--
-- Table structure for table `bugs`
--

DROP TABLE IF EXISTS `bugs`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `bugs` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `task_type` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Тип баг-репорта',
  `category` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'баг чего нашли',
  `severity` enum('critical','high','medium','low','very low') COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'серьезность бага',
  `summary` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Заголовок',
  `body` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'описание бага',
  `author_id` int(10) unsigned NOT NULL COMMENT 'id автора',
  `status` enum('unassigned','assigned','unconfirmed','waiting on response') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'статус репорта',
  `architecture` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Архитектура, на которой найден баг',
  `priority` enum('high','normal','medium','low','very low') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'приоритет задачи',
  `percent` tinyint(4) DEFAULT NULL COMMENT 'Процент выполнения',
  `votes` int(10) unsigned DEFAULT NULL COMMENT 'Апвоуты',
  `private` tinyint(1) DEFAULT NULL COMMENT 'приватность',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время редактирования',
  PRIMARY KEY (`id`),
  KEY `bugs_author_id_fk` (`author_id`),
  KEY `bugs_category_idx` (`category`),
  KEY `bugs_task_type_idx` (`task_type`),
  CONSTRAINT `bugs_author_id_fk` FOREIGN KEY (`author_id`) REFERENCES `wiki_users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

