DROP TABLE IF EXISTS `forum_comments`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `forum_comments` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `post_id` int(10) unsigned NOT NULL COMMENT 'К какому посту коммент',
  `author_id` int(10) unsigned NOT NULL COMMENT 'Автор коммента',
  `body` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Сам коммент',
  `created_at` datetime DEFAULT current_timestamp(),
  `edited_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `forum_comments_post_id_fk` (`post_id`),
  KEY `forum_comments_author_id_fk` (`author_id`),
  CONSTRAINT `forum_comments_author_id_fk` FOREIGN KEY (`author_id`) REFERENCES `forum_users` (`id`),
  CONSTRAINT `forum_comments_post_id_fk` FOREIGN KEY (`post_id`) REFERENCES `forum_posts` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

