CREATE TABLE `forum_users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `username` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Имя пользователя',
  `password` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Пароль',
  `email` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'эл. почта',
  `timezone` enum('AKDT','PDT','MDT','CDT','EDT','ADT','WGST') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Часовой пояс',
  `daylight_saving` tinyint(1) DEFAULT NULL COMMENT 'Переход на зимнее/летнее время',
  `language` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Язык пользователя',
  `post_counter` int(10) unsigned DEFAULT NULL COMMENT 'Счетчик постов',
  `group_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на группу',
  `from_where` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Откуда пользователь',
  `avatar` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'ссылка на аватар',
  `online_flag` tinyint(1) DEFAULT NULL COMMENT 'Онлайн ли в настоящее время',
  `real_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Реальное имя пользователя',
  `website` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Ссылка на веб-сайт пользователя',
  `signature` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Подпись под постом',
