  `last_visit` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `forum_users_group_id_fk` (`group_id`),
  KEY `forum_users_username_idx` (`username`),
  KEY `forum_users_email_idx` (`email`),
  KEY `forum_users_from_where_idx` (`from_where`),
  CONSTRAINT `forum_users_group_id_fk` FOREIGN KEY (`group_id`) REFERENCES `forum_groups` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
