--
-- Table structure for table `images`
--

DROP TABLE IF EXISTS `images`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `images` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `author_id` int(10) unsigned NOT NULL COMMENT 'кто выложил',
  `current_release` varchar(25) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Версия релиза',
  `included_kernel` varchar(25) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Версия ядра linux',
  `iso_size` int(10) unsigned NOT NULL COMMENT 'Размер образа',
  `checksums` varchar(25) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Чексумма образа',
  `mirror_id` int(10) unsigned DEFAULT NULL COMMENT 'Внешний ключ для таблицы зеркал',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `images_author_id_fk` (`author_id`),
  KEY `images_mirror_id_fk` (`mirror_id`),
  KEY `images_included_kernel_idx` (`included_kernel`),
  CONSTRAINT `images_author_id_fk` FOREIGN KEY (`author_id`) REFERENCES `wiki_users` (`id`),
  CONSTRAINT `images_mirror_id_fk` FOREIGN KEY (`mirror_id`) REFERENCES `mirrors` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

