--
-- Table structure for table `news`
--

DROP TABLE IF EXISTS `news`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `news` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название новости',
  `body` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Сама новость',
  `author_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на профиль автора',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время редактирования',
  PRIMARY KEY (`id`),
  KEY `news_author_id_fk` (`author_id`),
  KEY `news_title_idx` (`title`),
  CONSTRAINT `news_author_id_fk` FOREIGN KEY (`author_id`) REFERENCES `wiki_users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

