--
-- Table structure for table `packages`
--

DROP TABLE IF EXISTS `packages`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `packages` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `architecture` enum('any','x86_64') COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Архитектура',
  `repository` enum('community','community-testing','core','extra','KDE-unstable','multilib','multilib-testing','testing') COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'тип репозитория',
  `name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название пакета',
  `version` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'версия пакета',
  `description` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'описание пакета',
  `license` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Под лицензией GPL etc.',
  `upstream_url` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Ссылка на файл',
  `package_size` int(11) NOT NULL COMMENT 'Размер пакета',
  `install_size` int(11) NOT NULL COMMENT 'Размер пакета после установки',
  `last_packager_id` int(10) unsigned DEFAULT NULL COMMENT 'Создатель последней упаковки',
  `signed_by_id` int(10) unsigned DEFAULT NULL COMMENT 'Подписано кем',
  `package_contents` text COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Содержимо пакета',
  `build_date` datetime DEFAULT NULL COMMENT 'Когда создан билд',
  `signature_date` datetime DEFAULT NULL COMMENT 'Когда подписан',
  `last_update` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `packages_last_packager_id_fk` (`last_packager_id`),
  KEY `packages_signed_by_id_fk` (`signed_by_id`),
  KEY `packages_name_idx` (`name`),
  KEY `packages_package_size_idx` (`package_size`),
  CONSTRAINT `packages_last_packager_id_fk` FOREIGN KEY (`last_packager_id`) REFERENCES `wiki_users` (`id`),
  CONSTRAINT `packages_signed_by_id_fk` FOREIGN KEY (`signed_by_id`) REFERENCES `wiki_users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

