--
-- Table structure for table `security`
--

DROP TABLE IF EXISTS `security`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `security` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `package_id` int(10) unsigned NOT NULL COMMENT 'id пакета',
  `author_id` int(10) unsigned NOT NULL COMMENT 'id автора',
  `status` enum('vulnerable','not affected','fixed') COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Статус уязвимости',
  `severity` enum('critical','high','medium','low','very low') COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'серьезность уязвимости',
  `remote` tinyint(1) NOT NULL COMMENT 'Уязвимость удаленная?',
  `type` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Тип уязвимости',
  `affected` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Версии подверженные уязвимости',
  `fixed` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Если пофикшено, то в какой версии',
  `current` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Текущая версия пакета',
  `ticket` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'номер тикета',
  `description` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Описание уязвимости',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания',
  PRIMARY KEY (`id`),
  KEY `security_package_id_fk` (`package_id`),
  KEY `security_author_id_fk` (`author_id`),
  KEY `security_type_idx` (`type`),
  CONSTRAINT `security_author_id_fk` FOREIGN KEY (`author_id`) REFERENCES `wiki_users` (`id`),
  CONSTRAINT `security_package_id_fk` FOREIGN KEY (`package_id`) REFERENCES `packages` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

