DROP TABLE IF EXISTS `wiki_contents`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `wiki_contents` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `category` enum('Arch linux','FAQ','Installation guide','General recommendations','List of applications') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Категория статьи',
  `title` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Заголовок статьи',
  `author_id` int(10) unsigned NOT NULL COMMENT 'Кто создал',
  `body_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на таблицу со статьями',
  `created_at` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `wiki_contents_author_id_fk` (`author_id`),
  KEY `wiki_contents_body_id_fk` (`body_id`),
  KEY `wiki_contents_title_idx` (`title`),
  CONSTRAINT `wiki_contents_author_id_fk` FOREIGN KEY (`author_id`) REFERENCES `wiki_users` (`id`),
  CONSTRAINT `wiki_contents_body_id_fk` FOREIGN KEY (`body_id`) REFERENCES `wiki_bodys` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

